  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Benton
  Lake National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the management plan. Refuge administration is outlined; information about personnel,
  youth programs, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, grazing, haying, fire management, pest
  control, and water rights. The wildlife section of the report discusses wildlife
  diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, animal control, and disease control. The public
  uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, trapping, wildlife observation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, communication systems,
  and energy conservation. Cooperative programs and items of interest are provided
  at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
